import { Button, Input } from "antd";
import { useState } from "react";
import "./App.css";

function App() {
  const [data, setData] = useState("");
  return (
    <>
      <div>
        <Input
          type="text"
          placeholder="Enter Value Here!!!"
          onChange={(e) => setData(e.target.value)}
          value={data}
        />
        <Button type="primary">Submit</Button>
      </div>
    </>
  );
}

export default App;
